{"title":"[INSPIRE] Country fiche / Interoperability","type":"markdown","params":{"markdown":"## Interoperability of spatial data sets (step 4)

The interoperability of spatial data sets is an outlook on the readiness of Member States to make their spatial data interoperable according to the interoperability specifications laid down in the INSPIRE interoperability implementing regulation ([Commission Regulation (EU) No 1089/2010]()http://eur-lex.europa.eu/legal-content/EN/TXT/?uri=CELEX:02010R1089-20131230&qid=1400675738563). The deadlines for implementation of the spatial data interoperability are in the future: 23/11/2017 for Annex I data and 21/10/2020 for Annex II and III data. 


### Evolution of the conformity with INSPIRE interoperability specifications for spatial data"},"aggs":[],"listeners":{}}

